@ruki_ezlove2 セブンのコピー機の画面に『プリント』があるから押して、次に『ネットプリント』を押す。
予約番号を入力する画面が表示されたら、番号入力して間違いが無ければ右下に『確認』ボタンがあるから押す。
1つの予約番号で2枚まで印刷可能だから設定→コピー(*^^*)

